INSERT INTO `ak_life_style_instructions` (`life_style_instructions_id`, `disease_category`, `disease_name`, `language`, `life_style_instructions`) VALUES
(1, 'General', 'General', 'Marathi', '➤ रोज किमान 2 / 3 वेळा शिवाम्बु पान करा.\r\nसकाळी 1 पेला शिवाम्बु + 1 चमचा त्रिफला पावडर (1 त्रिफला गोळी) सेवन करा.\r\nदुपारी जेवानानंतर 3 तासानी 1 पेला शिवाम्बु सेवन करा.\r\nरात्री 1 पेला शिवाम्बु + 1 चमचा गुलवेल पावडर सेवन करा.\r\n    \r\n'),
(2, 'General', 'General', 'Marathi', '➤ आठवड्यातून  एक  दिवस  सर्व  शिवांबू  व  भरपूर  पाणी  पिऊन  उपवास करा .  त्यादिवशी  सकाळी  2 चमचे VC  चूर्ण  1 पेला  गरम  पाण्यातून  सेवन करा .'),
(3, 'General', 'General', 'Marathi', '➤ आठ  दिवस  शिळ्या किंवा उकळवुन एक चतुर्थांश आटविलेल्या  शिवांबूत 1 - 2 चमचे कापूर पावडर करून मिसळा व त्याने  सर्वांगास / व्याधिग्रस्त भागास मॉलिश करा व  त्या नंतर कोवळे सूर्यस्नान घ्या  (आठवड्यातून........वेळा ). '),
(4, 'General', 'General', 'Marathi', '➤ सकाळी ताज्या शिवांबूने नस्यपान व नेती करा (आठवड्यातून ........वेळा ). \r\n'),
(5, 'General', 'General', 'Marathi', '➤ सकाळी ताज्या शिवांबूने नत्राप्रक्षालन करा. डोळ्याचे  व्यायाम  व  त्राटक  नियमित करा. (आठवड्यातून ........वेळा ).   '),
(6, 'General', 'General', 'Marathi', '➤ व्याधीग्रत भागावर 1 ते 2 तास  शिवाम्बूच्या पट्ट्या  ठेवा .  (दिवसातून ........वेळा ).'),
(7, 'General', 'General', 'Marathi', '➤ रोज सकाळी लवकर उठा व निर्देशित योग व्यायाम व प्राणायाम नियमितपणे करा. '),
(8, 'General', 'General', 'Marathi', '➤ रोज  संध्याकाळी / रात्री 45 ते 60 मिनिटे न थांबता सलग जलद चालण्याचा व्यायाम करा . त्या नंतर 5 - 10 मिनिट शवासन करा. '),
(9, 'General', 'General', 'Marathi', '➤ रोज  संध्याकाळी / रात्री 15 मिनिटे डीप रेलॅक्सएशन टेकनीक (शवासन) / योगनिद्रा करा.  रात्री  झोपण्या पूर्वी  9 वेळा ओंकार उच्चार करा . '),
(10, 'General', 'General', 'Marathi', '➤ रोज रात्री तांब्याच्या भांडयामध्ये दोन ग्लास पाणी साठवून ठेवावे व ते पाणी दुसऱ्या दिवशी सकाळी कोमट करुन उषःपान म्हणून तहान नसतानाही प्यावे. अतिवजन असणार्यांनी अर्धा लिंबू पिळून ते पाणी प्यावे.'),
(11, 'General', 'General', 'Marathi', '➤ बेल, उंबर, तुळस, दुर्वा व कडुनिंब या दैवी वनस्पतींची प्रत्येकी पाच पाने रोज चावून खावीत किंवा प्रत्येकी वीस ताजी पाने, एकत्र करुन, ती चांगली चेचून तो लगदा गोळा जाळीदार कापडात टाकून कोमट पाण्यात बुडवून, पिळून त्याचा अर्क किंवा रस काढावा व त्यात दोन चमचे मध घालून घ्यावा. (........ दिवस).'),
(12, 'General', 'General', 'Marathi', '➤ रोज गाजर, काकडी, बीट, मुळा, मेथी, पालक, पात्री, भेंडी, कोबी, फलॉवर, कोथिंबीर, दुधीभोपळा, कारली, दोडका, टोमॅटो, आल्ले इ. फळभाज्या व पालेभाज्या बारीक कापून त्यांची कच्ची सलाद चावून खावी.'),
(13, 'General', 'General', 'Marathi', '➤ मूग, मटकी, मसूर, शेंगदाणा, मेथ्या, चवळी, खपली गहू इ. कडधान्यांचे कच्चे मोडं चावून खावीत. तसेच या सर्व कडधान्यांना वाफवून  घुगर्या करुन खाव्यात. मक्याच्या, ज्वारीच्या लाह्या, राजगिर्याचे लाडू  देखील चालतील.'),
(14, 'General', 'General', 'Marathi', '➤ सर्व प्रकारची सीजनल फळे भरपूर खावित. पेरू, पपाई, केळी, सीताफळ, चिकू , आंबा, सफरचंद, नाशपती , पीयर , बोरं , किवी, संत्री, मोसंबी, कलिंगड  इत्यादी मोसमी फळे रोज खावीत.  कच्ची  व आंबट फळे टाळावीत .  शेंदेलोण, पादेलोण, अल्प प्रमाणात चालेल. मीठ टाळावे . '),
(15, 'General', 'General', 'Marathi', '➤ सोयाबीनची कॉफी, पातळ अदमूरे ताजे ताक, मुगाचे कळण, नाचणीची आंबील, ज्वारीच्या कण्या, ब्राउन राइस - भाताची पेज, हिरव्या भाज्यांचे सूप, फळ-भाज्यांचे सूप, हळीव खीर, कुलिथ माडगे, फळांचा रस  इ. द्रवरुप पदार्थ भुकेनुसार खावेत.'),
(16, 'General', 'General', 'Marathi', '➤ चहा, कॉफी, मांसाहार (मांस, मटण, मच्छी, अंडी), बेकारीचे, मैद्याचे अन्न पदार्थ,  मसालेदार, तेलकट, तिखट, मिर्चीचे, साखरेचे पदार्थ,  हॉटेलमधील अन्न पदार्थ, अतितेलकट, तिखट, मसालेदार व अति शिजवलेले अन्न पूर्णपणे बंद करा. एकाच वेळी  तडस पोट भरे  पर्यंत  भोजन करू नका. दारु, तंबाखू, धूम्रपान ई. व्यसने आजच बंद करा. '),
(17, 'General', 'General', 'Marathi', '➤ कोंडा मिश्रित पीठाची  - ज्वारीची, नाचणीची, बाजरीची, मक्याची  भाकरी / खपली गव्हाची फुलकी खाणेस चालेल. सोबत अल्प प्रमाणात फोडणी टाकून बनविलेल्या, सर्व प्रकारच्या पालेभाज्या, फळभाज्या, मोड आलेल्या कडधान्यांची उसळ, ताज्या ताकाची कढी चालेल.  '),
(18, 'General', 'General', 'Marathi', '➤ वराईच्या तांदळाची खिचडी, हातसडीच्या तांदळाचा (ब्राउन राईस) भात,  मोड आलेल्या कढधान्यांना वाटून त्याची बिनतेलाची आंबोळी/डोसा खाणेस चालेल. सोबत खोबऱ्याची सौम्य चटणी चालेल.  खपली गव्हाच्या सोजी-रव्या चे  उपीट व  गुळातील सोजी चालेल.  '),
(19, 'General', 'General', 'Marathi', '➤ सकाळी नाष्ट्या अगोदर, १ पेला दुधी भोपळ्याचा  रस प्या. पाव किलो कोवळा दुधी  + ५ पुदिना पाने  + ५ तुळशीची पाने + पाव चमचा सैदव मीठ एकत्र मिक्सरवर फिरवून रस काढावा. (आठवड्यातून ........वेळा ).'),
(20, 'Metabolic Diseases', 'Obesity', 'Marathi', '➤ सकाळी नाष्ट्या अगोदर, १ पेला दुधी भोपळ्याचा रस प्या. पाव किलो कोवळा दुधी + ५ पुदिना पाने + ५ तुळशीची पाने + पाव चमचा सैदव मीठ एकत्र मिक्सरवर फिरवून रस काढावा. (आठवड्यातून ........वेळा ).'),
(21, 'Cardio Vascular Diseases', 'Hyperlipidemia', 'Marathi', '➤ सकाळी नाष्ट्या अगोदर, १ पेला दुधी भोपळ्याचा रस प्या. पाव किलो कोवळा दुधी + ५ पुदिना पाने + ५ तुळशीची पाने + पाव चमचा सैदव मीठ एकत्र मिक्सरवर फिरवून रस काढावा. (आठवड्यातून ........वेळा ).'),
(22, 'General', 'General', 'Marathi', '➤ रोज दिवसातून दोन वेळा (सकाळी  व  रात्री), १ चमचा मेथीचे दाणे न चावता, पाण्यासोबत सेवन करावेत.'),
(23, 'Metabolic Diseases', 'Diabetes Mellitus Type - II', 'Marathi', '➤ रोज दिवसातून दोन वेळा (सकाळी व रात्री), १ चमचा मेथीचे दाणे न चावता, पाण्यासोबत सेवन करावेत.'),
(24, 'Digestive Diseases', 'Constipation', 'Marathi', '➤ रोज दिवसातून दोन वेळा (सकाळी व रात्री), १ चमचा मेथीचे दाणे न चावता, पाण्यासोबत सेवन करावेत.'),
(25, 'General', 'General', 'Marathi', '➤ रोज दुपारी जेवणानंतर २ चमचे जवस पावडर + २ चमचे ताजे दही / साय, एकत्र मिसळून सेवन करा.'),
(26, 'Oncological Diseases', 'Common_O', 'Marathi', '➤ रोज दुपारी जेवणानंतर २ चमचे जवस पावडर + २ चमचे ताजे दही / साय, एकत्र मिसळून सेवन करा.'),
(27, 'Cardio Vascular Diseases', 'Ischemic Heart Disease', 'Marathi', '➤ रोज दुपारी जेवणानंतर २ चमचे जवस पावडर + २ चमचे ताजे दही / साय, एकत्र मिसळून सेवन करा.'),
(28, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रोज दुपारी जेवणानंतर २ चमचे जवस पावडर + २ चमचे ताजे दही / साय, एकत्र मिसळून सेवन करा.'),
(29, 'General', 'General', 'Marathi', '➤ सकाळी नाष्ट्या अगोदर, १ वाटी भेंडी-अर्क  प्या. रात्री १ - २ भेंड्या चिरून, १ वाटी  पाण्यात भिजवून ठेवा व  सकाळी ते कुस्करून, त्याचा अर्क, गाळून घ्या.  (आठवड्यातून ........वेळा ).'),
(30, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ सकाळी नाष्ट्या अगोदर, १ वाटी भेंडी-अर्क प्या. रात्री १ - २ भेंड्या चिरून, १ वाटी पाण्यात भिजवून ठेवा व सकाळी ते कुस्करून, त्याचा अर्क, गाळून घ्या. (आठवड्यातून ........वेळा ).'),
(31, 'General', 'General', 'Marathi', '➤ संध्याकाळी १ - २ डाळिंबाचे दाणे सोलून, त्याचा १ पेला ताजा रस  सेवन करा. रस काढताना त्यात छोटी डाळिंबाची साल सुद्धा टाका.'),
(32, 'Oncological Diseases', 'Common_O', 'Marathi', '➤ संध्याकाळी १ - २ डाळिंबाचे दाणे सोलून, त्याचा १ पेला ताजा रस सेवन करा. रस काढताना त्यात छोटी डाळिंबाची साल सुद्धा टाका.'),
(33, 'General', 'General', 'Marathi', '➤ रोज रात्री ८ - १० काळे मनुके २ कप पाण्यात भिजवून ठेवा आणि सकाळी ते एकत्र उकळवा व कुस्करून, नाष्ट्यानंतर सेवन करा. '),
(34, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रोज रात्री ८ - १० काळे मनुके २ कप पाण्यात भिजवून ठेवा आणि सकाळी ते एकत्र उकळवा व कुस्करून, नाष्ट्यानंतर सेवन करा.'),
(35, 'Hematological Diseases', 'Common_H', 'Marathi', '➤ रोज रात्री ८ - १० काळे मनुके २ कप पाण्यात भिजवून ठेवा आणि सकाळी ते एकत्र उकळवा व कुस्करून, नाष्ट्यानंतर सेवन करा.'),
(36, 'General', 'General', 'Marathi', '➤ रोज दुपारी १ चमचा गुलकंद सेवन करा. '),
(37, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रोज दुपारी १ चमचा गुलकंद सेवन करा.'),
(38, 'General', 'General', 'Marathi', '➤  रोज सकाळी नाष्ट्यानंतर १ मोर आवळा पाकासह सेवन करा. '),
(39, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रोज सकाळी नाष्ट्यानंतर १ मोर आवळा पाकासह सेवन करा.'),
(40, 'General', 'General', 'Marathi', '➤ रोज जेवणानंतर २ चमचे ताजे लोणी + २ चमचे खडीसाखर पावडर मिसळून सेवन करा.'),
(41, 'Metabolic Diseases', 'Under-weight', 'Marathi', '➤ रोज जेवणानंतर २ चमचे ताजे लोणी + २ चमचे खडीसाखर पावडर मिसळून सेवन करा.'),
(42, 'General', 'General', 'Marathi', '➤  रोज रात्रीच्या जेवणानंतर २ कप दूध + ५ भिजविलेले खजूर / अंजीर  + १ चमचा अश्वगंधा पावडर, मिक्सरवर मिसळून, त्याचे  मिल्कशेक सेवन करा. '),
(43, 'Metabolic Diseases', 'Under-weight', 'Marathi', '➤ रोज रात्रीच्या जेवणानंतर २ कप दूध + ५ भिजविलेले खजूर / अंजीर + १ चमचा अश्वगंधा पावडर, मिक्सरवर मिसळून, त्याचे मिल्कशेक सेवन करा.'),
(44, 'General', 'General', 'Marathi', '➤ दिवसातून २ वेळा, पत्ता कोबीची वाफ नका-तोंडातून  ग्रहण करा. '),
(45, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ दिवसातून २ वेळा, पत्ता कोबीची वाफ नका-तोंडातून ग्रहण करा.'),
(46, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ दिवसातून २ वेळा, १ चमचा आल्याचा रस  किंवा अर्धा चमचा सुंठ पावडर + १ चमचा मध मिसळून सेवन करा. '),
(47, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ ३ ते ४ ग्लास कोमट मिठाचे पाणी सलग प्या व त्यानंतर त्याची उल्टी करून, वामन क्रिया करा. (आठवड्यातून ........वेळा ).'),
(48, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ दिवसातून ३ वेळा, गरम मिठाच्या पाण्याच्या / ताज्या शिवाम्बूच्या घश्यातुन गूळन्या करा.'),
(49, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ दिवसातून ३ वेळा, ताजे शिवांबू  काही वेळ तोंडात धरून चुळा भरा. '),
(50, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ सुरण कंदाच्या ५-६ स्लाइस (पातळ काप) काढून, त्यांच्या दोन्ही बाजूस तूप लावून, तव्यावर भाजून घ्या व  रात्रीच्या जेवणासोबत सेवन करा. '),
(51, 'OBG Diseases', 'Oligospermia', 'Marathi', '➤  एक देशी केळ सालीसह उभे कापा, त्यामध्ये १ चमचा गजगा (सागरगोटा) पावडर लावा, केळ पुन्हा बंद करून रात्रभर तसेच ठेवा. सकाळी नाष्ट्या नंतर ते सोलून भरपूर चावून खावा. '),
(52, 'OBG Diseases', 'Oligospermia', 'Marathi', '➤ २ चमचे सूर्यफुलाच्या टरफल काढलेल्या बिया + १ चमचा खसखस, रात्री २ चमचे मधात भिजून  सकाळी नाष्ट्या नंतर सेवन करा.'),
(53, 'OBG Diseases', 'Azoospermia', 'Marathi', '➤ एक देशी केळ सालीसह उभे कापा, त्यामध्ये १ चमचा गजगा (सागरगोटा) पावडर लावा, केळ पुन्हा बंद करून रात्रभर तसेच ठेवा. सकाळी नाष्ट्या नंतर ते सोलून भरपूर चावून खावा.'),
(54, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ रोज दोन वेळा, शेवग्याच्या पानांचा  ४ चमचे  रस सेवन करा व आठवड्यातून  ३ वेळा शेवग्याच्या शेंगेची भाजी / सूप  सेवन करा. (सलग ........दिवस).'),
(55, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ रोज रात्री , ४ चमचे निरगुडीच्या पानांचा रस + २ चमचे पातळ केलेले गायीचे तूप, मिसळून सेवन करा. (सलग ........दिवस).'),
(56, 'Neurological Diseases', 'Common_N', 'Marathi', '➤ रोज रात्री , ४ चमचे निरगुडीच्या पानांचा रस + २ चमचे पातळ केलेले गायीचे तूप, मिसळून सेवन करा. (सलग ........दिवस).'),
(57, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ रोज दुपारी, एक काप ओल्या खोबऱ्याचे (नारळाचे ) दूध  सेवन करा. (सलग ........दिवस).'),
(58, 'Digestive Diseases', 'Hepatitis', 'Marathi', '➤ एक कप बकरीचे / शेळीचे दूध  + ५ चमचे तोंडलीचा रस मिसळून सेवन करा. (सलग .........दिवस). '),
(59, 'Neurological Diseases', 'Peripheral Neuropathy', 'Marathi', '➤ रात्री कार्ल्याच्या पानांचा रस काढून, भगभगणाऱ्या पायांवर  / तळव्यांवर  चोळा. (सलग .........दिवस).'),
(60, 'Oncological Diseases', 'Common_O', 'Marathi', '➤ व्याधीग्रत भागावर 1 ते 2 तास शिवाम्बूच्या पट्ट्या ठेवा . (दिवसातून ........वेळा ).'),
(61, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤  नेहमी गरम कपडे वापरा. पायमोजे, स्वेटर व कानटोपी यांचा वातावरणानुसार उपयोग करा. थंडी/गारठ्यापासून शरीरास सुरक्षीत ठेवा. '),
(62, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ दिवसभर शक्यतो गरम कोमट पाणी प्या.'),
(63, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ काकडी, केळी, ओले खोबरे, पेरू, कलिंगड, आंबट दही ताक, उसाचा रस, शहाळ्याचे पाणी यासारखे कफकारक अन्न  पदार्थ कफ-खोकला असताना टाळा.'),
(64, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤  रोज किमान ३० ते ४० मिनिटे, श्वसनाचे व्यायाम व सर्व प्राणायाम करा. '),
(65, 'Respiratory Diseases', 'Common_R', 'Marathi', '➤ छातीत विझिंग - कफ - खोकला जाणवल्यास, रात्री  छाती व पाठीवर गरम पाण्याच्या पिशवीने शेका. कोबी वाफ घ्या.'),
(66, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ हृदयाची कार्य क्षमता सुधारण्यासाठी रोज ३० ते ६० मिनिट सलग चालण्याचा व्यायाम करा. सूर्यनमस्कार घालणे, पोहणे उत्तम. '),
(67, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ आहारात अति-गोड व स्निग्ध (तेलयुक्त), खारट पदार्थ बंद करा. दूध व दुधाचे पदार्थ, मांसाहार बंद करा. '),
(68, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ नियमित पोट साफ होण्यावर भर द्या. गरिष्ठ अन्न बंद करा. तडस पोट  भरे पर्यन्त  भोजन करू नका.'),
(69, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ मनास शांत ठेवण्यासाठी रोज ध्यान करा. तणावमुक्ती साठी  रोज शवासन, योगनिद्रा, सायक्लिक मेडिटेशन करा. '),
(70, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ ब्लड प्रेशर संयमित ठेवण्यासाठी रोज १५ ते २० मिनिटे गरम-पाद-स्नान घ्या. (आठवड्यातून ........वेळा ).'),
(71, 'Cardio Vascular Diseases', 'Common_C', 'Marathi', '➤ बी.पी. च्या गोळ्या एकदम बंद करू नका. दर महिन्याला तज्ञाकडून बी.पी. तपासून घ्या.'),
(72, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ नियमित पोट साफ होण्यावर भर द्या. रोज सकाळी ३-४ ग्लास गरम-कोमट / लिंबू पाणी पिऊन उष:पान करा. '),
(73, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ आहारात कच्या भाज्यांची सलाद, मोड आलेली कडधान्ये, कोशिंबीर या सारख्या तंतुमय पदार्थांचा समावेश वाढावा.'),
(74, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रात्री कडुलिंबाची साल, १ पेला पाण्यात भिजवून, सकाळी ते पाणी प्या. (सलग .........दिवस).'),
(75, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रोज ३० ते ४५ मिनिटे प्राणायाम करा. कपालभांति, उद्यानबंध, अग्नीसार क्रिया रोज करा.'),
(76, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ दिवसातून २ वेळा, शिवांबू तोंडात धरून, बोटाने हिरड्या व दातांवर मॉलिश करा. (सलग .........दिवस).'),
(77, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रात्री पोटावर अर्धा चमचा एरंड तेल लावून, गरम पाण्याच्या पिशवीने पोट शेका. (सलग .........दिवस).'),
(78, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ रात्री ताज्या शिवांबू मध्ये  भिजविलेला कापूस, गुदद्वाराजवळ ठेवा. (सलग .........दिवस).'),
(79, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ फिंगर ग्लाऊज  घालून, बोटावर अर्धा चमचा एरंड तेल / खोबरेल तेल / गाईचे तूप घेऊन, गुदद्वारास आतून-बाहेरून मॉलिश करा. (सलग .........दिवस).'),
(80, 'Digestive Diseases', 'Common_D', 'Marathi', '➤ दुपारी / संध्याकाळी  २०-३० मिनिटे  थंड कटी स्नान घ्या. (आठवड्यातून ........वेळा ). \r\n'),
(81, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ आपल्या व्याधी साठी निर्देशित व्यायाम, योग-प्रकार नियमित करा. '),
(82, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ रोज सकाळी व रात्री, १५ ते २० मिनिटे भिंतीचा आधार घेऊन विपरीतकर्णी आसन करा.'),
(83, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ रोज सकाळी व रात्री, १५ मिनिटे, पोटावर झोपून माकरासान करा'),
(84, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ हरभरा, शेंगदाणे, वाटाणा, वांगे, बटाटा, म्हशीचे दूध यासारखे वातकारक पदार्थ बंद करा.'),
(85, 'Musculo-skeletal Diseases', 'Common_M', 'Marathi', '➤ पुढे वाकून वजन उचलणे, मोटर सायकल वरून दीर्घ प्रवास करणे, कॉम्प्युटर अथवा मोबाईल वर मान पुढे वाकून कार्य करणे बंद करा.'),
(86, 'Oncological Diseases', 'Common_O', 'Marathi', '➤ आहार हेच आपले औषध आहे.  सात्विक, नैसर्गिक, आहाराने कॅन्सरची निश्चित रोकथाम होते.'),
(87, 'Oncological Diseases', 'Common_O', 'Marathi', '➤ आहारातील 60 ते 80 टक्के पदार्थ, कमीत कमी प्रक्रिया केलेले, अर्थात नैसर्गिक स्वरूपात सेवन करा.  हेच अन्न पोटभर घ्या.  वजन कमी होणार नाही याची खबरदारी घ्या.'),
(88, 'Endocrine Diseases', 'Common_E', 'Marathi', '➤ सकाळी पंधरा मिनिटे ताज्या/ शिळ्या शिवांबु ने गळा, घसा व मानेवर मॉलीश करा. '),
(89, 'Endocrine Diseases', 'Common_E', 'Marathi', '➤ रोज सर्वांगासन व  मत्स्यासनाचा नियमित अभ्यास करा.'),
(90, 'Endocrine Diseases', 'Common_E', 'Marathi', '➤ रात्री गळ्यावर अल्टरनेट गरम-थंड शेक द्या.'),
(91, 'Neurological Diseases', 'Common_N', 'Marathi', '➤ एक लिटर शिवाम्बू साठवा, त्यामध्ये एक ते दोन ओंजळ निर्गुडीची पाने मिसळा, एकत्र दहा मिनिटे उकळवा. रात्रभर तसेच ठेवून, सकाळी शिवाम्बू गाळून बाटलीत भरून ठेवा. रोज या शिवाम्बूने पाठ, मान, मज्जारज्जू , डोके / सर्वांगास मालिश करा.'),
(92, 'Neurological Diseases', 'Common_N', 'Marathi', '➤ रोज रात्री, गाईचे पातळ केलेले तूप दोन-दोन थेंब  नाकात टाका.'),
(93, 'Neurological Diseases', 'Common_N', 'Marathi', '➤ नियमितपणे  शिवांबू नस्यपान करा. रात्री ताज्या  शिवाम्बू चे दोन-चार थेंब नाकात टाका.'),
(94, 'Renal Diseases', 'Common_K', 'Marathi', '➤  दिवसभरात किमान तीन ते चार लिटर पाणी सेवन करा.'),
(95, 'Renal Diseases', 'Common_K', 'Marathi', '➤ दिवसभरात फक्त एक ते दीड लिटर पाणी (द्रवरूप आहार) सेवन करा.'),
(96, 'Renal Diseases', 'Common_K', 'Marathi', '➤ रोज सकाळी, एक कप कोथिंबिरीच्या पानांचा रस प्या. '),
(97, 'Renal Diseases', 'Common_K', 'Marathi', '➤ दुपारी एक शहाळ्याचे पाणी सेवन करा. (आठवड्यातून ........वेळा ).'),
(98, 'Renal Diseases', 'Common_K', 'Marathi', '➤  रोज दुपारी वीस ते तीस मिनिटे, थंड कटीस्नान घ्या.  (आठवड्यातून ........वेळा ).'),
(99, 'Skin Diseases', 'Common_S', 'Marathi', '➤ रोज किमान ३० ते ४० मिनिटे, श्वसनाचे व्यायाम व सर्व प्राणायाम करा.'),
(100, 'Skin Diseases', 'Common_S', 'Marathi', '➤ दोन्ही हाताची सर्व नखे, दर आठवड्याला स्वच्छ काढा.'),
(101, 'Skin Diseases', 'Common_S', 'Marathi', '➤ नियमितपणे त्वचेची व गुप्तांगांची स्वच्छता ठेवा.'),
(102, 'Skin Diseases', 'Common_S', 'Marathi', '➤ आपली अंतर्वस्त्रे (चड्डी, बनियन), टॉवेल इत्यादी धुतल्यानंतर उन्हात वाळवा अथवा इस्त्री करून वापरा.  ओलसर कपडे वापरू नका'),
(103, 'Skin Diseases', 'Common_S', 'Marathi', '➤ व्याधीग्रस्त त्वचेवर तीन ते चार तास  शिवांबूच्या पट्ट्या बांधा.'),
(104, 'Skin Diseases', 'Common_S', 'Marathi', '➤ व्याधीग्रस्त त्वचेवर तीन ते चार तास गरम मातीच्या पट्ट्या बांधा'),
(105, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ सर्व गोड पदार्थ, मिठाई, साखरेचे पदार्थ पूर्णतः बंद करा'),
(106, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ तांदळाचे पदार्थ, भात सुद्धा बंद करा.'),
(107, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ मानसिक ताणतणाव, धावपळ, मनाची घालमेल होईल असे प्रसंग टाळा.'),
(108, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ द्वि भुक्त आहार पद्धतीचे पालन करा.'),
(109, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ जगण्यासाठी खा,  खाण्यासाठी जगू नका.'),
(110, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ रोज सकाळी लवकर उठा व निर्देशित योग व्यायाम व प्राणायाम नियमितपणे करा'),
(111, 'Metabolic Diseases', 'Common_MD', 'Marathi', '➤ मनास शांत ठेवण्यासाठी रोज ध्यान करा. तणावमुक्ती साठी रोज शवासन, योगनिद्रा, सायक्लिक मेडिटेशन करा.'),
(112, 'OBG Diseases', 'Common_OB', 'Marathi', '➤ दुपारी २० ते ३० मिनिटे थंड मेहंन स्नान (सीझ बाथ) घ्या. (आठवड्यातून ........वेळा ). '),
(113, 'OBG Diseases', 'Common_OB', 'Marathi', '➤ दुपारी ३० मिनिटे (५ मि. गरम ↦ ५ मि. थंड ↦ ५ मि. गरम ↦ ५ मि. थंड ↦ ५ मि. गरम ↦ ५ मि. थंड ) अल्टरनेट गरम-थंड कटिस्नान घ्या. (आठवड्यातून ........वेळा ).  '),
(114, 'OBG Diseases', 'Common_OB', 'Marathi', '➤ रोज सकाळी व संध्याकाळी, भिंतीचा आधार घेऊन दहा मिनिटे विपरीत करणी आसन करा व त्यावेळी अश्विनी क्रिया करा.'),
(115, 'General', 'General', 'Marathi', '➤ रोज आठ तास शांत झोप घ्या व जागरण करू नका.'),
(116, 'OBG Diseases', 'Common_OB', 'Marathi', '➤ रोज आठ तास शांत झोप घ्या व जागरण करू नका.'),
(117, 'General', 'General', 'Hindi', '➤ हररोज 2 से 3 बार शिवाम्बु पान करे. सुबह 1 गिलास  शिवाम्बु + 1 चमच त्रिफला पावडर (1 त्रिफला गोली) सेवन करे. दोपहर में भोजन के 3 घंटे बाद 1 गिलास शिवाम्बु सेवन करें. रात में 1 गिलास शिवाम्बु + 1 चमच गीलोई पावडर सेवन करें.'),
(118, 'General', 'General', 'Hindi', '➤ हप्ते में एक दिन पुरे दिनभर की शिवांम्बु और भरपूर पानी पीकर उपवास करें. उस दिन सुबह 2 चम्मच VC चूर्ण 1 गिलास गरम पानी के साथ सेवन करें.'),
(119, 'General', 'General', 'Hindi', '➤ आठ दिन की पुरानी या उबालकर एक चौथाई की हुई 1 कप शिवाम्बु में 2 चम्मच कपूर की पावडर मिलाएं और उससे पुरे शरीर को और व्याधिग्रस्त भाग पर मॉलिश करे और उसके बाद सुबह की कच्ची, हलकी धुप में सूर्यस्नान लें (हप्ते में........बार).'),
(120, 'General', 'General', 'Hindi', '➤ सुबह ताजे शिवाम्बु से नस्यपान और नेती करें (हप्ते में........बार).'),
(121, 'General', 'General', 'Hindi', '➤ सुबह ताजे शिवाम्बु से नेत्र प्रक्षालन करें. आँखों के व्यायाम और त्राटक नियमितरूप से करें. (हप्ते में........बार).'),
(122, 'General', 'General', 'Hindi', '➤ व्याधीग्रत भागपर 2 घंटे शिवाम्बू की पट्टियाँ रखें. (दिन में........बार).'),
(123, 'General', 'General', 'Hindi', '➤ हररोज सुबह जल्दी उठे और निर्देशित योग व्यायाम और प्राणायाम नियमितरूप से करें.'),
(124, 'General', 'General', 'Hindi', '➤ हररोज शाम / रात में 60 मिनिटे बिना रुके निरंतर जलद चालने का व्यायाम करें. उसके बाद 10 मिनिट तक शवासन करें.'),
(125, 'General', 'General', 'Hindi', '➤ रोज शाम / रात में 15 मिनिट डीप रिलॅक्सेशन टेकनीक (शवासन) / योगनिद्रा करें. रात में सोने से पहले  9 बार ओंकार का उच्चार करें .'),
(126, 'General', 'General', 'Hindi', '➤ हररोज रात में सोते समय तांबे के बरतन में दो गिलास पानी भरकर रखें और दुसरे दिन सुबह, प्यास न होने पर भी, उस पानी को गुनगुना करके उषःपान के रुपमें सेवन करें. मोटापे से ग्रस्त लोगो को, उस पानी में आधे निम्बू का रस डालकर पीना चाहिए.'),
(127, 'General', 'General', 'Hindi', '➤ बेल, अवदुम्बर (गूलर), तुळसी, दुर्वा घास व कडुनिंब इन दैवी वनस्पतींयों में से हर एक वनस्पती के पांच-पांच पत्ते, हररोज चबाकर या हर एक वनस्पती के बीस पत्तों को अच्छे से कूटकर, उसका मिश्रण जालीदार कपडे  में डालकर, उसे गुनगुने पानी में डुबोकर, उसे निचोड़कर उसका अर्क या रस निकालें और उसमें दो चम्मच शहद मिलाकर सेवन करें. (........ दिन).'),
(128, 'General', 'General', 'Hindi', '➤ हररोज गाजर, ककडी, बीट, मुली, मेथी, पालक, पात्री, भेंडी, गोबी, फलॉवर, कोथिंबीर, लौकी (दुधी), करेला, तुरई, टमाटर, अदरक इ. सब्जियों को बारीक काटकर उसकी कच्ची सलाद चबाकर खाएं.'),
(129, 'General', 'General', 'Hindi', '➤ मुंग, मटकी, मसूर, मूंगफली, मेथी के दाने, लोबिया (चवली), देसी गेहूं इ. के अंकुरित अनाज चबाकर खाए.  चाहे तो सभी अंकुरित अनाजो कों उबालकर खां सकते है. साथ ही में मकई के / जावर के पॉपकॉर्न, राजगिरा के लड्डू भी खा सकते हैं.\r\n'),
(130, 'General', 'General', 'Hindi', '➤ सभी प्रकार के मौसमी फल भरपूर खाएं. अमरुद, पपीता, केले, सीताफल, चिकू, आम, सेब, नाशपती, पीयर, बेर, किवी, संतरे, मुसम्बी, तरबूज इत्यादी मोसमी फल हररोज खाएं. कच्चे और खट्टे फलों का सेवन टाल दें. शेंदेलोण, पादेलोण जैसे रॉक-सोल्ट का सेवन कर सकते है. नमक को पूरी तरह से वर्ज्य करें.'),
(131, 'General', 'General', 'Hindi', '➤ सोयाबीन की कॉफी, पतला ताजा ताक, मुंग का सूप, रागी की आंबील (खीर), जवार की कणी, ब्राउन चावल की गंजी, हरी सब्जियों का सूप, फल-सब्जियों का सूप, हलीम की खीर, कुलिथी की खीर, फलों का रस इ. द्रवरुप पदार्थ भुक के अनुसार खाएं.'),
(132, 'General', 'General', 'Hindi', '➤ चाय, कॉफी, मांसाहार (मांस, मटण, मच्छी, अंडे), बेकारी के,  मैदे से बने अन्न पदार्थ, मसालेदार, तले हुएं, तिखे, मिर्च से बने, शक्कर से बने, हॉटेल के  अन्न पदार्थ, ज्यादा तला हुआ, तिखा और ज्यादा पका हुआ अन्न पूर्णरूप से  बंद करें. एक ही समय पर अति पेट भरकर भोजन न करें.'),
(133, 'General', 'General', 'Hindi', '➤ चोकर (छिलका) मिश्रित आटे की जवार की, रागी की, बाजरी की, मके की रोटी, देसी गेहूं की बिना तेल की रोटी स्वास्थ्य के लिए अच्छी होती है. साथ में कम प्रमाण में तेल डालकर तडका लगाई हुई, सभी प्रकार की हरी सब्जियाँ, फल-सब्जियाँ, अंकुरित अनाज की सब्जी (उसल), ताजे छाछ की कढी भी ले सकते हैं.'),
(134, 'General', 'General', 'Hindi', '➤ वरई के चावल की खिचडी, ब्राउन-राईस चावल, अंकुरित अनाजों को पीसकर बिना तेल का डोसा खा सकते हैं. उसके साथ नारियल की सौम्य चटणी खा सकते हैं. देसी गेहूं के सोजी-रवा से बना उपमा और गुड से बनी सोजी भी खा सकते हैं. '),
(135, 'General', 'General', 'Hindi', '➤ सुबह नाश्ते से पहले, १ गिलास लौकी का रस पिएँ. पाव किलो कच्ची लौकी  + ५ पुदिने के पत्ते + ५ तुलसी के पत्ते  + पाव चम्मच सैदव नमक इनको इकट्ठा करके मिक्सरपर पीसकर उसका रस निकालें. (हप्ते में  .......बार).'),
(136, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ सुबह नाश्ते से पहले, १ गिलास लौकी का रस पिएँ. पाव किलो कच्ची लौकी  + ५ पुदिने के पत्ते + ५ तुलसी के पत्ते  + पाव चम्मच सैदव नमक इनको इकट्ठा करके मिक्सरपर पीसकर उसका रस निकालें. (हप्ते में  .......बार).'),
(137, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ सुबह नाश्ते से पहले, १ गिलास लौकी का रस पिएँ. पाव किलो कच्ची लौकी  + ५ पुदिने के पत्ते + ५ तुलसी के पत्ते  + पाव चम्मच सैदव नमक इनको इकट्ठा करके मिक्सरपर पीसकर उसका रस निकालें. (हप्ते में  .......बार).'),
(138, 'General', 'General', 'Hindi', '➤ हररोज दिन में दो बार (सुबह और रात में), १ चम्मच मेथी के दाने बिना चबाएँ, पानी के साथ सेवन करें.'),
(139, 'Metabolic Diseases', 'Diabetes Mellitus Type - II', 'Hindi', '➤ हररोज दिन में दो बार (सुबह और रात में), १ चम्मच मेथी के दाने बिना चबाएँ, पानी के साथ सेवन करें.'),
(140, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ हररोज दिन में दो बार (सुबह और रात में), १ चम्मच मेथी के दाने बिना चबाएँ, पानी के साथ सेवन करें.'),
(141, 'General', 'General', 'Hindi', '➤ हररोज दोपहर में भोजन के बाद २ चम्मच अलसी  पावडर + २ चम्मच ताजा दही या मलाई, इकट्ठा मिलाकर सेवन करें.'),
(142, 'Oncological Diseases', 'Common_O', 'Hindi', '➤ हररोज दोपहर में भोजन के बाद २ चम्मच अलसी  पावडर + २ चम्मच ताजा दही या मलाई, इकट्ठा मिलाकर सेवन करें.'),
(143, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ हररोज दोपहर में भोजन के बाद २ चम्मच अलसी  पावडर + २ चम्मच ताजा दही या मलाई, इकट्ठा मिलाकर सेवन करें.'),
(144, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ हररोज दोपहर में भोजन के बाद २ चम्मच अलसी  पावडर + २ चम्मच ताजा दही या मलाई, इकट्ठा मिलाकर सेवन करें.'),
(145, 'General', 'General', 'Hindi', '➤ सुबह नाश्ते से पहले, १ कटोरी भिन्डी का अर्क पी लें. रात में  १ – २ भिन्डी को काटकर, १ कटोरी पानी में  भिगोकर रखें और सुबह उसे निचोड़कर, उसका अर्क, छान लें. (हप्ते में........बार ).'),
(146, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ सुबह नाश्ते से पहले, १ कटोरी भिन्डी का अर्क पी लें. रात में  १ – २ भिन्डी को काटकर, १ कटोरी पानी में  भिगोकर रखें और सुबह उसे निचोड़कर, उसका अर्क, छान लें. (हप्ते में........बार ).'),
(147, 'General', 'General', 'Hindi', '➤ शाम में १ - २ अनार के, दाने छीलकर, उसका १ गिलास ताजा रस सेवन करें. रस निकालते समय उसमें अनार की थोडी सा छालका भी डालें.'),
(148, 'Oncological Diseases', 'Common_O', 'Hindi', '➤ शाम में १ - २ अनार के, दाने छीलकर, उसका १ गिलास ताजा रस सेवन करें. रस निकालते समय उसमें अनार की थोडी सा छालका भी डालें.'),
(149, 'General', 'General', 'Hindi', '➤ हररोज रात में ८ - १० काले मुनक्के २ कप पानी में भिगोकर रखें और सुबह उसे इकट्ठा उबालें और उसे पिसकर, नाश्ते के बाद सेवन करें.'),
(150, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ हररोज रात में ८ - १० काले मुनक्के २ कप पानी में भिगोकर रखें और सुबह उसे इकट्ठा उबालें और उसे पिसकर, नाश्ते के बाद सेवन करें.'),
(151, 'General', 'General', 'Hindi', '➤ हररोज दोपहर में १ चम्मच गुलकंद सेवन करें.'),
(152, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ हररोज दोपहर में १ चम्मच गुलकंद सेवन करें.'),
(153, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ सुबह नाश्ते के बाद १ मोर-आँवला मीठे रस (पाक) के साथ सेवन करें.'),
(154, 'General', 'General', 'Hindi', '➤ सुबह नाश्ते के बाद १ मोर-आँवला मीठे रस (पाक) के साथ सेवन करें.'),
(155, 'General', 'General', 'Hindi', '➤ हररोज भोजन के बाद २ चम्मच ताजा मक्खन + २ चम्मच खडीशक्कर (मिश्री) की पावडर मिलाकर सेवन करें.'),
(156, 'Metabolic Diseases', 'Under-weight', 'Hindi', '➤ हररोज भोजन के बाद २ चम्मच ताजा मक्खन + २ चम्मच खडीशक्कर (मिश्री) की पावडर मिलाकर सेवन करें.'),
(157, 'General', 'General', 'Hindi', '➤ हररोज रात में भोजन उपरान्त  २ कप दूध + ५ भिगोएँ हुए  खजूर या अंजीर + १ चमचा अश्वगंधा पावडर, मिक्सर में  मिलाकर, उसका मिल्कशेक सेवन करें.'),
(158, 'Metabolic Diseases', 'Under-weight', 'Hindi', '➤ हररोज रात में भोजन उपरान्त  २ कप दूध + ५ भिगोएँ हुए  खजूर या अंजीर + १ चमचा अश्वगंधा पावडर, मिक्सर में  मिलाकर, उसका मिल्कशेक सेवन करें.'),
(159, 'General', 'General', 'Hindi', '➤ दिन में २ बार, पत्ता गोबी की बाफ नाक और मुंह से ग्रहण करें.'),
(160, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ दिन में २ बार, पत्ता गोबी की बाफ नाक और मुंह से ग्रहण करें.'),
(161, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ दिन में २ बार, १ चम्मच अदरक का रस आधा चम्मच सोंठ पावडर + १ चम्मच शहद मिलाकर सेवन करें.'),
(162, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ ३ से ४ गिलास नमक का गुनगुना पानी एकसाथ पी लें और उसके बाद उसकी उल्टी निकलकर, वमन क्रिया करें. (हप्ते में ........बार).'),
(163, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ दिन ३ बार, नमक के गुनगुने पानी / ताजा शिवाम्बू से गले में से गरारे करें.'),
(164, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ दिन में ३ बार, ताजा शिवाम्बु कुछ देर तक मुंह में लेकर उससे माउथवॉश  करें.'),
(165, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ सुरण कंद की ५-६ पतले स्लाइस निकालकर, उन्हें दोनों तरफ से घी लगाकर, तवे पर गरम करके रात के खाने के साथ सेवन करें.'),
(166, 'Digestive Diseases', 'Hemorrhoids', 'Hindi', '➤ सुरण कंद की ५-६ पतले स्लाइस निकालकर, उन्हें दोनों तरफ से घी लगाकर, तवे पर गरम करके रात के खाने के साथ सेवन करें.'),
(167, 'OBG Diseases', 'Common_OB', 'Hindi', '➤ एक देशी केले को, छिलके के साथ ही सीधा काट लें, उसमें १ चम्मच कतिकरंजा (गजगा) का पावडर लगा लें, केले को फिर से बंद करके पूरी रात वैसा ही रखें. सुबह नाश्ते के बाद उसे छीलकर भरपूर चबकर खाएं.'),
(168, 'OBG Diseases', 'Oligomenorrhea', 'Hindi', '➤ एक देशी केले को, छिलके के साथ ही सीधा काट लें, उसमें १ चम्मच कतिकरंजा (गजगा) का पावडर लगा लें, केले को फिर से बंद करके पूरी रात वैसा ही रखें. सुबह नाश्ते के बाद उसे छीलकर भरपूर चबकर खाएं.'),
(169, 'OBG Diseases', 'Azoospermia', 'Hindi', '➤ एक देशी केले को, छिलके के साथ ही सीधा काट लें, उसमें १ चम्मच कतिकरंजा (गजगा) का पावडर लगा लें, केले को फिर से बंद करके पूरी रात वैसा ही रखें. सुबह नाश्ते के बाद उसे छीलकर भरपूर चबकर खाएं.'),
(170, 'OBG Diseases', 'Oligospermia', 'Hindi', '➤ २ चम्मच सूर्यफुल के बीज (छिलका निकले हुएं) + १ चम्मचा खसखस, इनको रात में २ चम्मच शहद में भिगोकर, सुबह नाश्ते के बाद सेवन करें.'),
(171, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ हररोज दो बार, सहजन के पत्तों का ४ चम्मच रस सेवन करें और हप्ते में ३ बार सहजन की सब्जी  / सूप सेवन करें. (लगातार .....दिन).'),
(172, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ हररोज रात में, ४ चम्मच निरगुडी के पत्तों का रस + २ चम्मच गाय का पतला घी, मिलाकर सेवन करें. (लगातार .....दिन).'),
(173, 'Neurological Diseases', 'Common_N', 'Hindi', '➤ हररोज रात में, ४ चम्मच निरगुडी के पत्तों का रस + २ चम्मच गाय का पतला घी, मिलाकर सेवन करें. (लगातार .....दिन).'),
(174, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ हररोज दोपहर में, एक कप नारियल के दूध का सेवन करें. (लगातार .....दिन).'),
(175, 'Neurological Diseases', 'Common_N', 'Hindi', '➤ हररोज दोपहर में, एक कप नारियल के दूध का सेवन करें. (लगातार .....दिन).'),
(176, 'Digestive Diseases', 'Hepatitis', 'Hindi', '➤ एक कप बकरी का दूध + ५ चम्मच कूंदरू (तोंडली) का रस मिलाकर सेवन करें. (लगातार .....दिन).'),
(177, 'Neurological Diseases', 'Peripheral Neuropathy', 'Hindi', '➤ रात में करेले के पत्तों का रस निकालकर, जलन होनेवाले पावं पर/ तलवे पर लगाए. (लगातार .....दिन).'),
(178, 'Oncological Diseases', 'Common_O', 'Hindi', '➤ व्याधीग्रस्त भागपर 2 घंटो तक शिवाम्बू की पट्टीयां रखें. (दिन में ........बार).'),
(179, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ व्याधीग्रस्त भागपर 2 घंटो तक शिवाम्बू की पट्टीयां रखें. (दिन में ........बार).'),
(180, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ हमेशा गरम कपडे पहने. पायमोजे, स्वेटर और कानटोपी इनका वातावरण के अनुसार उपयोग करें. थंड/सर्दी से शरीर को सुरक्षीत रखें.'),
(181, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ दिनभर गरम-गुनगुना पाणी पिएँ.'),
(182, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ अगर कफ-खांसी की तकलीफ है, तो ककडी, केले, नारियल, अमरुद, तरबूज, खट्टा दही-छाछ, गन्ने का रस, नारियल पानी, ऐसे कफकारक अन्न पदार्थ वर्ज करें.'),
(183, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ रोज कम से कम ३० से ४० मिनट, श्वसन के व्यायाम और प्राणायाम के सभी प्रकार करें.'),
(184, 'Respiratory Diseases', 'Common_R', 'Hindi', '➤ सिने में विझिंग - कफ – खाँसी का एहसास होनेपर, रात में सिनेपर और पीठपर, गरम पानी की थैली से सेकें. साथ ही में गोबी की बाफ लें.'),
(185, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ हृदय की कार्यक्षमता सुधारने के लिए हर रोज ३० से ६० मिनट लगातार चलने का व्यायाम करें. सूर्यनमस्कार और तैरने का व्यायाम बहोत अच्छा है.'),
(186, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ आहार में ज्यादा मीठे और स्निग्ध (तेलयुक्त), नमकीन पदार्थ बंद करें. दूध और दुध से बने पदार्थ, मांसाहार पूरी तरह से बंद करें.'),
(187, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ नियमित पेट की सफाई पर ध्यान दें. गरिष्ठ अन्न बंद करें. अति पेट भरने तक भोजन न करें.'),
(188, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ मन को शांत रखने के लिए, ध्यान करें. तणावमुक्ती के लिए रोज शवासन, योगनिद्रा, सायक्लिक मेडिटेशन करें.'),
(189, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ ब्लड प्रेशर संयमित रखने के लिए रोज १५ से २० मिनिट गरम-पाद-स्नान लें. (हप्ते में ........बार ).'),
(190, 'Cardio Vascular Diseases', 'Common_C', 'Hindi', '➤ बी.पी. की दवाइयां एकदम से बंद न करें. हर महिने तज्ञ डॉक्टर से बी.पी. की जांच करवाए.'),
(191, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ नियमित पेट की सफाई पर ध्यान दें. हररोज सुबह ३-४ गिलास गरम-गुनगुना / निम्बू पानी पिकर उष:पान करें.'),
(192, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ आहार में कच्ची सब्जियों का सलाद, अंकुरित अनाज, रायता/कोशिंबीर ऐसे तंतुमय पदार्थोंका उपयोग बढाइये.'),
(193, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ रात में कडुनिम्ब की छाल, १ गिलास पानी में भिगकर रखें, सुबह वह पाणी पिएँ. (लगातार .....दिन).'),
(194, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ हररोज ३० से ४५ मिनिट प्राणायाम करें. कपालभांति, उद्यानबंध, अग्नीसार क्रिया रोज करें.'),
(195, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ दिन में २ बार, शिवाम्बु को मुहं में रखकर, ऊँगली से मसूड़ों पर और दातों पर मसाज करें. (लगातार .....दिन).'),
(196, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ रात में पेटपर आधा चम्मच एरंड तेल लगाकर, गरम पानी की थैली से पेट को सेकें. (लगातार .....दिन).'),
(197, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ रात में ताजा शिवाम्बु में भिगोयां हुआ कापूस, गुदद्वार के पास रखें. (लगातार .....दिन).'),
(198, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ फिंगर ग्लाऊज पहनके, उंगली पर आधा चम्मच एरंड तेल / नारियल तेल / गाय का घी लेकर, गुदद्वार को अन्दर-बाहर से मसाज करें. (लगातार .....दिन).'),
(199, 'Digestive Diseases', 'Common_D', 'Hindi', '➤ दोपहर / शाम में २०-३० मिनट तक थंडा कटीस्नान लें. (हप्ते में  ........बार ).'),
(200, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ अपने रोग अनुसार निर्देशित व्यायाम, योग-प्रकार नियमित करें.'),
(201, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ हररोज सुबह और रात में, १५ से २० मिनिट, दीवार का सहारा लेकर विपरीतकर्णी आसन करें.'),
(202, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ हररोज सुबह और रात में, १५ मिनट, पेटपर लेटकर मकरासन करें.'),
(203, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ चना, मूंगफली, मटर, बैंगन, आलू, भैस का दूध ऐसे पदार्थ बंद करें.'),
(204, 'Musculo-skeletal Diseases', 'Common_M', 'Hindi', '➤ आगे झुककर वजन उठाना, मोटर साईकल से लम्बी दुरी तक प्रवास करना, कम्प्युटर अथवा मोबाईल पर गर्दन आगे झुकाकर काम करना बंद करें.'),
(205, 'Oncological Diseases', 'Common_O', 'Hindi', '➤ आहार ही आपकी दवाई है. सात्विक, नैसर्गिक, आहार से कॅन्सर की निश्चित रोकथाम होती है.'),
(206, 'Oncological Diseases', 'Common_O', 'Hindi', '➤ आहार में 60 से 80 प्रतिशत पदार्थ, कम से कम पाक-क्रिया किए हुए, अर्थात नैसर्गिक रूप में सेवन करें. यही अन्न पेटभर खाएं. वजन कम न हो इसका ख्याल रखें.'),
(207, 'Endocrine Diseases', 'Common_E', 'Hindi', '➤ सुबह पंधरा मिनट तक ताजा/बांसी शिवांबु से गला और गर्दन पर मालिश करें.'),
(208, 'Endocrine Diseases', 'Common_E', 'Hindi', '➤ हररोज सर्वांगासन और मत्स्यासन का नियमित अभ्यास करें.'),
(209, 'Endocrine Diseases', 'Common_E', 'Hindi', '➤ रात में गलेपर अल्टरनेट गरम-थंड शेक दें.'),
(210, 'Neurological Diseases', 'Common_N', 'Hindi', '➤ एक लिटर शिवाम्बू जमा करें, उसमें 150 ग्राम निर्गुडी के पत्ते मिलाईए, यह मिश्रण को इकट्ठा दस मिनिट तक उबालें. उसे रातभर वैसा रखकर, सूबह शिवाम्बू को छानकर, बोतल में भरकर रखें. हररोज शिवाम्बू से पीठ, मज्जारज्जू, सिर / सर्वांग को मालिश करें.'),
(211, 'Neurological Diseases', 'Common_N', 'Hindi', '➤ हररोज रात में गाय का पतला घी, लेकर उसकी दो-दो बुँदे नाका में डालें.'),
(212, 'Neurological Diseases', 'Common_N', 'Hindi', '➤ नियमित शिवाम्बु नस्यपान करें, रात में ताजे शिवाम्बू की दो-चार बुँदे नाक में डालें.'),
(213, 'Renal Diseases', 'Common_K', 'Hindi', '➤ दिनभर में कम से कम तीन से चार लिटर पानी सेवन करें.'),
(214, 'Renal Diseases', 'Common_K', 'Hindi', '➤ दिनभर में सिर्फ एक से डेढ़ लिटर पानी (द्रवरूप आहार) सेवन करें.'),
(215, 'Renal Diseases', 'Common_K', 'Hindi', '➤ हररोज सुबह, एक कप हरी धनियाँ के पत्तों का रस पिएँ.'),
(216, 'Renal Diseases', 'Common_K', 'Hindi', '➤ दोपहर में एक नारियल का पानी सेवन करें. (हप्ते में ........बार).'),
(217, 'Renal Diseases', 'Common_K', 'Hindi', '➤ हररोज दोपहर में बीस से तीस मिनट, थंडा कटीस्नान लें. (हप्ते में ........बार).'),
(218, 'Skin Diseases', 'Common_S', 'Hindi', '➤ हररोज कम से कम ३० से ४० मिनट, श्वसन के व्यायाम और सभी प्रकार के प्राणायाम करें.'),
(219, 'Skin Diseases', 'Common_S', 'Hindi', '➤ दोनों हातों के सभी नाख़ून, हर हप्ते में साफ करें.'),
(220, 'Skin Diseases', 'Common_S', 'Hindi', '➤ नियमित रूप से त्वचा और गुप्तांगो की सफाई रखें.'),
(221, 'Skin Diseases', 'Common_S', 'Hindi', '➤ अपने अंतर्वस्त्र (चड्डी, बनियन), टॉवेल इत्यादी धोने के बाद धूप में सुखाएं अथवा इस्त्री करके इस्तमाल करें. गिले कपड़े इस्तमाल न करें.'),
(222, 'Skin Diseases', 'Common_S', 'Hindi', '➤ व्याधीग्रस्त त्वचापर तीन से चार घंटो तक शिवाम्बु की पट्टियाँ बांधें.'),
(223, 'Skin Diseases', 'Common_S', 'Hindi', '➤ व्याधीग्रस्त त्वचापर तीन से चार घंटो तक गरम मिट्ठी की पट्टियाँ बांधें.'),
(224, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ सभी मीठे पदार्थ, मिठाई, शक्कर से बने पदार्थ पूर्णतः बंद करें.'),
(225, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ चावल से बने पदार्थ, चावल भी बंद करें.'),
(226, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ मानसिक ताणतणाव, भागदौड, मन को अस्थिर बनानेवाली घटनाओं से दूर रहें.'),
(227, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ द्वि भुक्त आहार (२ बार) पद्धती का पालन करें.'),
(228, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ जीने के लिए खाइए, खाने के लिएँ न जिएँ.'),
(229, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ हररोज सुबह जल्दी उठे और निर्देशित योग व्यायाम और प्राणायाम नियमितपणे करें.'),
(230, 'Metabolic Diseases', 'Common_MD', 'Hindi', '➤ मन को शांत रखने के लिए रोज ध्यान करें. तणावमुक्ती के लिए रोज शवासन, योगनिद्रा, सायक्लिक मेडिटेशन करें.'),
(231, 'OBG Diseases', 'Common_OB', 'Hindi', '➤ दोपहर में २० से ३० मिनिट थंडा मेहंन स्नान (सीझ बाथ) लें. (हप्ते में ........बार).'),
(232, 'OBG Diseases', 'Common_OB', 'Hindi', '➤ दोपहर में ३० मिनट  (५ मि. गरम ↦ ५ मि. थंडा ↦ ५ मि. गरम ↦ ५ मि. थंडा ↦ ५ मि. गरम ↦ ५ मि. थंडा ) अल्टरनेट गरम-थंडा कटिस्नान लें. (हप्ते में........बार).'),
(233, 'OBG Diseases', 'Common_OB', 'Hindi', '➤ हररोज सुबह और शाम, दीवार का सहारा लेकर दस मिनिट विपरीत करणी आसन करें. उस समय अश्विनी क्रिया करें.'),
(234, 'General', 'General', 'Hindi', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.'),
(235, 'OBG Diseases', 'Common_OB', 'Hindi', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.');
