INSERT INTO `ak_op_lifestyle_prescription` (`op_lifestyle_prescription_id`, `person_id`, `op_case_sheet_id`, `op_visit_id`, `visit_date`, `schedule`, `user_id`, `disease_name`, `life_style_instructions`) VALUES
(1, 21, 1, 1, '2018-12-17', 'Morning', 'Dr. Sarang', 'General', '➤ हररोज 2 से 3 बार शिवाम्बु पान करे. सुबह 1 गिलास शिवाम्बु + 1 चमच त्रिफला पावडर (1 त्रिफला गोली) सेवन करे. दोपहर में भोजन के 3 घंटे बाद 1 गिलास शिवाम्बु सेवन करें. रात में 1 गिलास शिवाम्बु + 1 चमच गीलोई पावडर सेवन करें.\r'),
(2, 21, 1, 1, '2018-12-17', 'Morning', 'Dr. Sarang', 'General', '➤ हप्ते में एक दिन पुरे दिनभर की शिवांम्बु और भरपूर पानी पीकर उपवास करें. उस दिन सुबह 2 चम्मच VC चूर्ण 1 गिलास गरम पानी के साथ सेवन करें.\r'),
(3, 21, 1, 1, '2018-12-17', 'Morning', 'Dr. Sarang', 'General', '➤ हररोज शाम / रात में 60 मिनिटे बिना रुके निरंतर जलद चालने का व्यायाम करें. उसके बाद 10 मिनिट तक शवासन करें.\r'),
(4, 21, 1, 1, '2018-12-17', 'Morning', 'Dr. Sarang', 'General', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.'),
(5, 217, 3, 2, '2019-01-04', 'Morning', 'Dr. Sarang', 'Common_N', '➤ रोज रात्री , ४ चमचे निरगुडीच्या पानांचा रस + २ चमचे पातळ केलेले गायीचे तूप, मिसळून सेवन करा. (सलग ........दिवस).\r'),
