INSERT INTO `ak_rt_followup_lifestyle` (`rt_followup_lifestyle_id`, `person_id`, `rt_case_sheet_id`, `rt_followup_id`, `followup_date`, `schedule`, `user_id`, `disease_name`, `life_style_instructions`) VALUES
(1, 124, 9, 1, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ रोज किमान 2 / 3 वेळा शिवाम्बु पान करा. सकाळी 1 पेला शिवाम्बु + 1 चमचा त्रिफला पावडर (1 त्रिफला गोळी) सेवन करा. दुपारी जेवानानंतर 3 तासानी 1 पेला शिवाम्बु सेवन करा. रात्री 1 पेला शिवाम्बु + 1 चमचा गुलवेल पावडर सेवन करा.\r'),
(2, 124, 9, 1, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ व्याधीग्रत भागावर 1 ते 2 तास शिवाम्बूच्या पट्ट्या ठेवा . (दिवसातून ........वेळा ).'),
(13, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज 2 से 3 बार शिवाम्बु पान करे. सुबह 1 गिलास शिवाम्बु + 1 चमच त्रिफला पावडर (1 त्रिफला गोली) सेवन करे. दोपहर में भोजन के 3 घंटे बाद 1 गिलास शिवाम्बु सेवन करें. रात में 1 गिलास शिवाम्बु + 1 चमच गीलोई पावडर सेवन करें.\r'),
(14, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हप्ते में एक दिन पुरे दिनभर की शिवांम्बु और भरपूर पानी पीकर उपवास करें. उस दिन सुबह 2 चम्मच VC चूर्ण 1 गिलास गरम पानी के साथ सेवन करें.\r'),
(15, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ सुबह ताजे शिवाम्बु से नेत्र प्रक्षालन करें. आँखों के व्यायाम और त्राटक नियमितरूप से करें. (हप्ते में........बार).\r'),
(16, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज सुबह जल्दी उठे और निर्देशित योग व्यायाम और प्राणायाम नियमितरूप से करें.\r'),
(17, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज शाम / रात में 60 मिनिटे बिना रुके निरंतर जलद चालने का व्यायाम करें. उसके बाद 10 मिनिट तक शवासन करें.\r'),
(18, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ रोज शाम / रात में 15 मिनिट डीप रिलॅक्सेशन टेकनीक (शवासन) / योगनिद्रा करें. रात में सोने से पहले 9 बार ओंकार का उच्चार करें .\r'),
(19, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज रात में सोते समय तांबे के बरतन में दो गिलास पानी भरकर रखें और दुसरे दिन सुबह, प्यास न होने पर भी, उस पानी को गुनगुना करके उषःपान के रुपमें सेवन करें. मोटापे से ग्रस्त लोगो को, उस पानी में आधे निम्बू का रस डालकर पीना चाहिए.\r'),
(20, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज दिन में दो बार (सुबह और रात में), १ चम्मच मेथी के दाने बिना चबाएँ, पानी के साथ सेवन करें.\r'),
(21, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.\r'),
(22, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', '➤ हररोज दोपहर में भोजन के बाद २ चम्मच अलसी पावडर + २ चम्मच ताजा दही या मलाई, इकट्ठा मिलाकर सेवन करें.'),
(23, 237, 68, 3, '2019-01-11', 'Morning', 'Dr. Yogesh', 'General', '➤ रोज किमान 2 / 3 वेळा शिवाम्बु पान करा. सकाळी 1 पेला शिवाम्बु + 1 चमचा त्रिफला पावडर (1 त्रिफला गोळी) सेवन करा. दुपारी जेवानानंतर 3 तासानी 1 पेला शिवाम्बु सेवन करा. रात्री 1 पेला शिवाम्बु + 1 चमचा गुलवेल पावडर सेवन करा.\r'),
(24, 237, 68, 3, '2019-01-11', 'Morning', 'Dr. Yogesh', 'General', '➤ रोज दुपारी जेवणानंतर २ चमचे जवस पावडर + २ चमचे ताजे दही / साय, एकत्र मिसळून सेवन करा.\r'),
(25, 237, 68, 3, '2019-01-11', 'Morning', 'Dr. Yogesh', 'General', '➤ संध्याकाळी १ - २ डाळिंबाचे दाणे सोलून, त्याचा १ पेला ताजा रस सेवन करा. रस काढताना त्यात छोटी डाळिंबाची साल सुद्धा टाका.\r'),
(26, 237, 68, 3, '2019-01-11', 'Morning', 'Dr. Yogesh', 'General', '➤ रोज संध्याकाळी / रात्री 15 मिनिटे डीप रेलॅक्सएशन टेकनीक (शवासन) / योगनिद्रा करा. रात्री झोपण्या पूर्वी 9 वेळा ओंकार उच्चार करा .'),
(54, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हररोज 2 से 3 बार शिवाम्बु पान करे. सुबह 1 गिलास शिवाम्बु + 1 चमच त्रिफला पावडर (1 त्रिफला गोली) सेवन करे. दोपहर में भोजन के 3 घंटे बाद 1 गिलास शिवाम्बु सेवन करें. रात में 1 गिलास शिवाम्बु + 1 चमच गीलोई पावडर सेवन करें.\r'),
(55, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हप्ते में एक दिन पुरे दिनभर की शिवांम्बु और भरपूर पानी पीकर उपवास करें. उस दिन सुबह 2 चम्मच VC चूर्ण 1 गिलास गरम पानी के साथ सेवन करें.\r'),
(56, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ आठ दिन की पुरानी या उबालकर एक चौथाई की हुई 1 कप शिवाम्बु में 2 चम्मच कपूर की पावडर मिलाएं और उससे पुरे शरीर को और व्याधिग्रस्त भाग पर मॉलिश करे और उसके बाद सुबह की कच्ची, हलकी धुप में सूर्यस्नान लें (हप्ते में........बार).\r'),
(57, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ व्याधीग्रत भागपर 2 घंटे शिवाम्बू की पट्टियाँ रखें. (दिन में........बार).\r'),
(58, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ रोज शाम / रात में 15 मिनिट डीप रिलॅक्सेशन टेकनीक (शवासन) / योगनिद्रा करें. रात में सोने से पहले 9 बार ओंकार का उच्चार करें .\r'),
(59, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ शाम में १ - २ अनार के, दाने छीलकर, उसका १ गिलास ताजा रस सेवन करें. रस निकालते समय उसमें अनार की थोडी सा छालका भी डालें.\r'),
(60, 522, 83, 5, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.'),
(61, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हररोज 2 से 3 बार शिवाम्बु पान करे. सुबह 1 गिलास शिवाम्बु + 1 चमच त्रिफला पावडर (1 त्रिफला गोली) सेवन करे. \r'),
(62, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ सुबह नाश्ते से पहले, १ गिलास लौकी का रस पिएँ. पाव किलो कच्ची लौकी + ५ पुदिने के पत्ते + ५ तुलसी के पत्ते + पाव चम्मच सैदव नमक इनको इकट्ठा करके मिक्सरपर पीसकर उसका रस निकालें. (हप्ते में .......बार).\r'),
(63, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हप्ते में एक दिन पुरे दिनभर की शिवांम्बु और भरपूर पानी पीकर उपवास करें. उस दिन सुबह 2 चम्मच VC चूर्ण 1 गिलास गरम पानी के साथ सेवन करें.\r'),
(64, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हररोज शाम / रात में 60 मिनिटे बिना रुके निरंतर जलद चालने का व्यायाम करें. उसके बाद 10 मिनिट तक शवासन करें.\r'),
(65, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ रोज शाम / रात में 15 मिनिट डीप रिलॅक्सेशन टेकनीक (शवासन) / योगनिद्रा करें. रात में सोने से पहले 9 बार ओंकार का उच्चार करें .\r'),
(66, 523, 84, 4, '2019-01-19', 'Morning', 'Dr. Yogesh', 'General', '➤ हररोज आठ घंटे शांत नींद लें और जागरण न करें.\r'),
