(20, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', 'Flex Seeds', '2 चम्मच पावडर + 2 चम्मच दही / पनीर / मलाई मिलाकर सेवन करें', '1\r'),
