(23, 122, 17, 2, '2018-12-28', 'Morning', 'Dr. Nitin', 'General', 'Liquid Gomutra Ark', '2.......0.......0 चम्मच अर्क, सुबह 150 ml गरम पानी के साथ + 2 Tab Triphala', '1\r'),
